import { useParams } from "react-router"
import "./component.css";

import Navbar from "./Navbar";
import axios from "axios";
import { useEffect, useState } from 'react';


function Carddetails(props){
var params = useParams(props)

var details = {
    username :"",
    projectname : "BakeHouse"
  }

    var [login,setLogin] = useState();
// setLogin = true;
let myphone = ()=> {
  // alert("d appjs myphone");
  setLogin(true);
}
var apiurl=`http://apibyashu.herokuapp.com/api/cake/ ${params.cakeid}`
var cakeid = params.cakeid
var [data,setData]=useState([]);
var [islodding,setLodding]=useState(true)
        useEffect(()=>{
            axios({method:"GET",url:apiurl,data:JSON}).then((response)=>{
                console.log("response",response.data.data)
                setData(response.data.data)
                setLodding(false)
            },(error)=>{

                console.log("error..",error)
                setLodding(false)
            });

},islodding)
    return(
        <>
         <Navbar isloggedin = {login} details = {details} >Kids</Navbar>
        <h1>CakeDETAILS {data.cakeid}</h1>
        <div class="media">
        <img src={data.image} class="mr-3" alt="Sample Image"/>
        <div class="media-body">
            <h5 class="mt-0">{data.name} <small><i>Posted on January 10, 2019</i></small></h5>
            <p>Excellent feature! I love it. One day I'm definitely going to put this Bootstrap component into use and I'll let you know once I do.</p>
        </div>
    </div>
        </>

    )
}
export default Carddetails
